module MTA

  def self.set_mta_data

    cleaned_mta_data = {}

    lines_name_color.each do |name_color|
      cleaned_mta_data[name_color[0]] = {
        name: name_color[0],
        color: name_color[1],
        stations: []
      }
    end


    data = JSON.parse(mta_json_data)['data']

    data.each do |entrance|

     address = entrance[9]
     lines = entrance[10].split('-')

     lines.each do |line|

      if cleaned_mta_data[line]
        cleaned_mta_data[line][:stations] << address
      end

     end

    end

    self.const_set(:LINES, cleaned_mta_data)
  end

